export var FETCH_POSTS_REQUEST = "FETCH_POSTS_REQUEST";
export var FETCH_POSTS_SUCCESS = "FETCH_POSTS_SUCCESS";
export var FETCH_POSTS_FAILURE = "FETCH_POSTS_FAILURE";
export function fetchPostsRequest(accountId) {
  return {
    type: FETCH_POSTS_REQUEST,
    accountId: accountId
  };
}
export function fetchPostsSuccess(posts) {
  return {
    type: FETCH_POSTS_SUCCESS,
    posts: posts
  };
}
export function fetchPostsFailure(error) {
  return {
    type: FETCH_POSTS_FAILURE,
    error: error
  };
}
